                }

                }

                }

                }

                }
            }

                animation: btnRecA 5s infinite;
            }

            @keyframes btnRecA {
                from {
                    fill: transparent;
                }

                40% {
                    fill: #75ffbd;
                }

                    fill: #75ffbd;
                }
            }

            }

            @keyframes myCircleA {

                from,
                40% {
                    r: 0;
                }

                60%,
                100% {
                    r: 50%;
                }
            }
